import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  Container,
  useTheme,
  useMediaQuery
} from '@mui/material';
import { Link } from 'react-router-dom';
import DirectionsBusIcon from '@mui/icons-material/DirectionsBus';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import LoginIcon from '@mui/icons-material/Login';

const Navbar = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <AppBar position="sticky" sx={{ backgroundColor: '#2c3e50' }}>
      <Container maxWidth="lg">
        <Toolbar disableGutters sx={{ justifyContent: 'space-between' }}>
          {/* Logo and Brand */}
          <Box component={Link} to="/" sx={{ 
            display: 'flex', 
            alignItems: 'center', 
            textDecoration: 'none', 
            color: 'inherit' 
          }}>
            <DirectionsBusIcon sx={{ mr: 1, fontSize: 32 }} />
            <Typography
              variant="h6"
              noWrap
              sx={{
                fontWeight: 700,
                letterSpacing: '.1rem',
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              GO-TICKET
            </Typography>
          </Box>

          {/* Navigation Links */}
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            {!isMobile && (
              <>
                <Button 
                  color="inherit" 
                  component={Link} 
                  to="/about"
                  sx={{ textTransform: 'none' }}
                >
                  About
                </Button>
                <Button 
                  color="inherit" 
                  component={Link} 
                  to="/contact"
                  sx={{ textTransform: 'none' }}
                >
                  Contact
                </Button>
              </>
            )}
            
            {/* Auth Buttons */}
            <Button 
              color="inherit"
              startIcon={<LoginIcon />}
              component={Link}
              to="/login"
              sx={{ 
                textTransform: 'none',
                '&:hover': {
                  backgroundColor: 'rgba(255, 255, 255, 0.1)'
                }
              }}
            >
              Login
            </Button>
            <Button 
              variant="contained"
              startIcon={<AccountCircleIcon />}
              component={Link}
              to="/register"
              sx={{ 
                bgcolor: '#27ae60',
                textTransform: 'none',
                '&:hover': {
                  bgcolor: '#219653'
                }
              }}
            >
              Sign Up
            </Button>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Navbar;
